闇を切り裂くLEDの光<br>
fcl.のledヘッドライトはハロゲンの2倍、4000ルーメンの明るさで安心安全の1年保証<br>
HIDのような、配線の取り回しは一切不要。バルブ交換と同じ感覚でかんたんled<br><br>
fcl.LEDヘッドライトは配光にこだわって商品を開発しました。<br>
HIDでは難しかったハイビームにも。取り付けも簡単。バルブ交換感覚でできます。<br><br>
<br>
■パッケージ内容<br>
・LEDヘッドライト(2個)<br>
・バルブ形状：HB3<br>
・取付パーツ<br>
・保証書兼取扱説明書<br><br>
■保証<br>
・1年完全保証(商品のみ。不良時の取付交換費用・車両への損害は保証対象外となります。)<br>
■適合車種<br>
・12V/24V車用<br><br>
■当店取付確認車種<br>
・アクア　H26.12～　NHP10　ロービーム/H11　フォグランプ/H16　ハイビーム/HB3<br>
・アルファード　H20.5～H23.10　GGH2#系　ハイビーム/HB3<br>
・ヴェルファイア　H20.5～H23.10　GGH2#系　ハイビーム/HB3<br>
・エスクァイア　H26.10～　ZWR80・ZRR8#　フォグランプ/H16　ハイビーム/HB3<br>
・プリウス　H21.5～H27.12　ZVW30　ハイビーム/HB3<br>
・VOXY　H26.1～　ZWR80・ZRR8#　フォグランプ/H16　ハイビーム/HB3<br>
・セレナ　H22.11～　C26　ヘッドライト/H11　フォグランプ/H8<br>
・ヴェゼル　H25.12～　RU1・2・3・4　フォグランプ/H8　ハイビーム/HB3<br>
・オデッセイ　H25.11～　RC1・2　フォグランプ/H8　ハイビーム/HB3<br>
・ムーヴカスタム　H22.12～H24.11　LA100・110S　ハイビーム/HB3<br>

　
<br>
※車検につきましてはライトの形状により光軸が綺麗にでない場合があります。純正バルブは必ず保管しておいてください。<br>
※商品後方部が膨らんでいる為、取付スペースは必ず確認してからご購入下さい。<br>
※後付けのカーパーツは純正パーツと違い完璧なフィッティングが得られない場合があります。<br>
また相性によりパーツが壊れたり、誤作動を起こすこともあります。<br>
商品の性質をご理解頂いたうえで、ご利用頂けたらと思います。<br>
