【形状】ハイビームHB3専用<br />
  【光色】ハイビーム5000k/6500k<br />
  【LED】バルブ1本：CREE「XHP50」２基<br />
  【全光束】車両1台分：6600ルーメン(バルブ2本分）<br />
  ※6600lmは6500kの測定値です。他の光色の全光束（ルーメン数）は多少異なります。<br />
  <br />
  【消費電力】3A/36w<br />
  【対応電圧】DC12V<br />
  【商品内容】<br />
  　　(1)LEDバルブ　2球<br />
  　　(2)結束バンド　2本<br />
  　　(3)取扱説明書（保証書)<br />
  ※ハイビームHB3専用には、六角レンチ、調整用ネジ（予備2本）付属<br />
  <br />
  【保証期間】発送日より、1年間 <br />
  【初期不良対応期間】発送日より、7営業日まで<br />
  <br />
【商品について】<br />
・「レダ」は弊社開発商品です。当店のレビュー、および、日本最大級クルマSNSサイト「みんカラ」等より、ユーザーの声を反映させ、改良を重ねてきました。そして、この度、「レダLA02」をパワーアップし、更なる進化を遂げた「レダLA02プラス」が完成しました。<br />
<br />
・純正ハロゲン球以上の配光を実現、明るさはHIDに匹敵。<br />
  ・全光束（ルーメン数）も大幅アップ！　車両1台分の明るさ「レダLA02」4200lm　⇒「レダLA02プラス」6600lm<br />
  ※6600lmは6500kの測定値です。他の光色の全光束（ルーメン数）は多少異なります。<br />
  <br />
・フォグランプのみならず、ハイビームにもおすすめ、充分な実用性を発揮します。<br />
・バルブ交換のみのシンプル簡単な作業性を実現した「一体型（オールインワン）」です。<br />
  ・ハロゲンのLCL条件を再現目標とし設計しているため、配光性能もハロゲンに準じています。<br />
  ・フォグランプでは、HV/PHVの低電力純正フォグランプにも使用可能です。
  <br />
・ハロゲンバルブより少ない電力で、より明るい光を再現、放射熱が殆どないため、樹脂灯体でも安心してご利用頂けます。<br />
  ・他の電装品と電路共有しても、ハロゲンやHIDと比較しても、必要電力が少ないため、不点灯などのトラブルも少ないのが特長です。
  <br />
・光色は、純正HIDの色に近い「5000ケルビン」と、より刺激的な白の「6500ケルビン」、H8 H9 H11 H16は、実用性重視のフォグに最適な「3000ケルビン」より、ご選択ください。<br />
<br />
・H10 HB3 HB4、HB3専用は、LED角度調整機能付きだから、バルブ取付角度が異なる車両には、ご自身で簡単に角度調整ができます。調整方法は、取扱説明書に記載していますので、安心して、お求めください。<br />
<br />
・国際標準化機構 :ISO 9001　ISO 17025 認証取得<br />
<br />
  ・当店の取り扱いブランドの中でも「レダ」は、高品質LEDで、大変ご好評いただいています。ぜひ、ポジション、バックランプ、ウインカーも、高品質「レダ」シリーズで、お揃えください。 <br />
  <br />
